
ord_a = ord('a')
ord_z = ord('z')
def opposite(s):
  return s.upper() if ord_a <= ord(s) <= ord_z else s.lower()

def react(str):
  stack = ['']
  for s in str:
    if stack[-1] == opposite(s):
      stack.pop()
    else:
      stack.append(s)
  return len(''.join(stack))



print(react('dabAcCaCBAcCcaDA'))

print(react(''))







